import React, { useEffect, useState } from "react";
import Button from '@material-ui/core/Button'


const USeEfct = (()=>{
    const [num , SetNum] = useState(0)

    useEffect(()=>{
        alert("Cliccked")
    })

    return (<Button onClick={
        ()=>{ SetNum(num+1)}
        
        }>{num}</Button>)

})
export default USeEfct
